-- ----------------------------
-- Table structure for task
-- ----------------------------
DROP TABLE IF EXISTS `task`;
CREATE TABLE `task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `task_name` varchar(255) NOT NULL,
  `task_details` varchar(255) DEFAULT NULL,
  `project_name` varchar(255) NOT NULL,
  `type` int(1) NOT NULL DEFAULT '0' COMMENT 'type  0:任务 1:BUG 2:功能 3:测试',
  `create_user` varchar(255) NOT NULL,
  `update_user` varchar(255) NOT NULL,
  `priority` int(1) NOT NULL DEFAULT '0' COMMENT 'priority  0：低级 1：中级 2：高级',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  `deadline` datetime NOT NULL,
  `assignee` varchar(255) DEFAULT NULL,
  `status` int(1) NOT NULL DEFAULT '0' COMMENT 'status  0:未完成 1：进行中 2：已完成',
  `task_comment` varchar(255) DEFAULT NULL,
  `deleted` int(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除deleted  0:未删除 1;已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

